import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter section to appear
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Wait for min and max price inputs
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.waitForSelector('#maxPrice', { timeout: 5000 });

    // Set min price to 100
    const minPriceInput = await page.$('#minPrice');
    await minPriceInput.click({ clickCount: 3 });
    await minPriceInput.type('100');

    // Set max price to 500
    const maxPriceInput = await page.$('#maxPrice');
    await maxPriceInput.click({ clickCount: 3 });
    await maxPriceInput.type('500');

    // Take screenshot after entering price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_entered_price_range.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_entered_price_range.png'));

    // Click the "Apply" button (by class and text)
    const applyBtn = await page.$('.apply-filter');
    await applyBtn.click();

    // Wait for products grid/list to update (wait for any product card to appear)
    await page.waitForSelector('.product-card, .product-card-list', { timeout: 5000 });

    // Take screenshot after filter applied
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_apply_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_apply_filter.png'));

    // Extract the visible product titles and prices after filter
    const products = await page.$$eval('.product-card, .product-card-list', nodes =>
      nodes.map(node => {
        const title = node.querySelector('.product-title')?.innerText || '';
        const priceText = node.querySelector('.product-price')?.innerText || '';
        // Extract first price number from priceText
        const priceMatch = priceText.match(/\$([\d,]+(\.\d+)?)/);
        const price = priceMatch ? parseFloat(priceMatch[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    // Filter products in the extractedData to only those in the 100-500 range (for verification)
    const filteredProducts = products.filter(p => typeof p.price === 'number' && p.price >= 100 && p.price <= 500);

    return {
      success: true,
      action: "Applied price range filter (100 to 500) and extracted filtered product titles and prices",
      extractedData: {
        filteredProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
